import React, { useState } from 'react';
import '../style/SoundPage.css';

export default function MusicInsights() {
  const [audioFeatureResults, setAudioFeatureResults] = useState([]); // State for results
  const [featureInputs, setFeatureInputs] = useState({
    instrumentalness: "",
    energy: "",
    valence: "",
    liveness: "",
    acousticness: "",
  });
  const [error, setError] = useState(""); // State for error messages
  const [loading, setLoading] = useState(false); // State for loading status

  // Fetch songs by audio features
  const fetchSongsByAudioFeatures = async () => {
    setError(""); // Clear previous errors
    setAudioFeatureResults([]); // Reset results before fetching
    setLoading(true); // Set loading status to true

    try {
      // Construct query parameters
      const queryParams = new URLSearchParams();
      for (const [key, value] of Object.entries(featureInputs)) {
        if (value.trim() !== "") {
          queryParams.append(key, value);
        }
      }

      // Ensure at least one parameter is included
      if (queryParams.toString() === "") {
        setError("Please provide at least one audio feature input.");
        setLoading(false);
        return;
      }

      const response = await fetch(`http://localhost:8080/songs/audio-features?${queryParams.toString()}`);
      if (!response.ok) {
        throw new Error(`Failed to fetch songs by audio features. Status: ${response.status}`);
      }

      const data = await response.json();

      // Debugging: Log the API response
      console.log("API Response:", data);

      if (data.length === 0) {
        setError("No songs found matching the specified audio features.");
      } else {
        setAudioFeatureResults(data); // Update state with fetched results
      }
    } catch (err) {
      console.error("Error fetching songs by audio features:", err);
      setError("An error occurred while fetching songs. Please try again later.");
    } finally {
      setLoading(false); // Set loading status to false
    }
  };

  // Handle changes to audio feature inputs
  const handleFeatureInputChange = (e) => {
    const { name, value } = e.target;
    setFeatureInputs((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <>
      {/* Navigation Bar */}
      <div id="sound-page-wrapper">
        <div id="navbar">
          <ul>
            <li><a href="http://localhost:3000/">HomePage</a></li>
            <li><a href="http://localhost:3000/search">Search Page</a></li>
            <li><a href="http://localhost:3000/genre">Genre Page</a></li>
            <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
          </ul>
        </div>

        <h1>Track Explorer</h1>

        <div id="page-wrapper">
          <div id="content-wrapper">
            {/* Search by Audio Features Section */}
            <section className="table-section">
              <h2>Find Songs by Audio Features</h2>
              <div className="controls">
                {Object.keys(featureInputs).map((key) => (
                  <label key={key}>
                    {key.charAt(0).toUpperCase() + key.slice(1)}:
                    <input
                      type="number"
                      name={key}
                      step="0.01"
                      min="0"
                      max="1"
                      value={featureInputs[key]}
                      onChange={handleFeatureInputChange}
                    />
                  </label>
                ))}
              </div>
              <button onClick={fetchSongsByAudioFeatures} disabled={loading}>
                {loading ? "Searching..." : "Search"}
              </button>
              {error && <div className="error-message">{error}</div>}
              {audioFeatureResults.length > 0 && (
                <table className="data-table">
                  <thead>
                    <tr>
                      <th>Track Title</th>
                      <th>URL</th>
                      <th>Instrumentalness</th>
                      <th>Energy</th>
                      <th>Valence</th>
                      <th>Liveness</th>
                      <th>Acousticness</th>
                    </tr>
                  </thead>
                  <tbody>
                    {audioFeatureResults.map((row) => (
                      <tr key={row.id}>
                        <td>{row.title}</td>
                        <td>
                          {row.url ? (
                            <a href={`https://${row.url}`} target="_blank" rel="noopener noreferrer">
                              Link
                            </a>
                          ) : (
                            "N/A"
                          )}
                        </td>
                        <td>{row.instrumentalness.toFixed(3) ?? "N/A"}</td>
                        <td>{row.energy.toFixed(3) ?? "N/A"}</td>
                        <td>{row.valence.toFixed(3) ?? "N/A"}</td>
                        <td>{row.liveness.toFixed(3) ?? "N/A"}</td>
                        <td>{row.acousticness.toFixed(3) ?? "N/A"}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              )}
            </section>
          </div>
        </div>
      </div>
    </>
  );
}
